package mt_var.probes;

import java.util.LinkedList;
import java.util.regex.Pattern;
import mt_var.neo4jlib.neo4j_qry;
import org.bitbucket.cowwoc.diffmatchpatch.DiffMatchPatch;
import org.neo4j.procedure.Description;
import org.neo4j.procedure.Name;
import org.neo4j.procedure.UserFunction;


public class dmp {
    @UserFunction
    @Description("compares two probes using dmp")

    public String dmp_two_probes(
        @Name("probe1") 
            String probe1,
        @Name("probe2") 
            String probe2
  )
   
         { 
             
        String d = dmp_probes(probe1, probe2);
         return d;
            }

    
    
    public static void main(String args[]) {
       String s1 ="--";
        String s2 = "";
        
        String r =dmp_probes(s1,s2); 
                //dmp_probes("ATAAAAACCCAATCCACATCAAAACCCCCTCCCCATGCTTACAAGCAAGTACAGCAACCAACCCTCAACTATCACACATCAACTGCAACTCCAAAGCCACCTCTCACCCACTAGGATACCAACAAACCTACCCACCCTTAACAGTACATAGTACATAAAGCCATCTACCGTACATAGCACATTACAGTCAAATCCCTTCT", "ATAAAAACCCAATCCACATCAAAACCCCCTCCCCATGCTTACAAGCAAGTACAGCAACCAACCCTCAACTATCACACATCAACTGCAACTCCAAAGCCACCTCTCACCCACTAGGATACCAACAAACCTACCCACCCTTAACAGTACATAGTACATAAAGCCATCTACCGTACATAGCACATTACAGTCAAATCCCTTCT");
//        System.out.println(r);
    String rs[] = r.split(Pattern.quote("*"));
    for(int i= 0; i<rs.length; i++)
        if(rs[i].strip().compareTo("")!=0)
    {
        System.out.println(rs[i]); 
    }
    }
    
     public static String dmp_probes(String seq1, String seq2) 
    {
        mt_var.neo4jlib.neo4j_info.neo4j_var();
        mt_var.neo4jlib.neo4j_info.neo4j_var_reload();
        
       DiffMatchPatch dmp = new DiffMatchPatch();
        LinkedList<DiffMatchPatch.Diff> diffs = dmp.diffMain(seq1, seq2);
//        dmp.diffCleanupSemantic(diffs);
        
        String s = "";
        for(int  i=0; i<diffs.size(); i++)
                {
                   s = s + diffs.get(i).operation + ": " + diffs.get(i).text + "  *  ";
                }
        return s;
    }
}
